function arrayUnion(array) {
  var head = Caml_array.get(array, 0);
  var queue = array.slice(1);
  return queue.reduce((function (result, suArray) {
                return result.filter(function (letter) {
                            return suArray.includes(letter);
                          });
              }), head).length;
}

